INSERT INTO `v1_8f9199e357093312a006a129654df3e8099ec24ff4976fd5031b575b0d97de83` VALUES (10021, 24, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 1, "2030/12/17 14:59:59", 0.0, 0.0, "カオリ（サマー）", 0.0, 110501, 4, "2019/07/31 12:00:00", 24015, 4);
INSERT INTO `v1_8f9199e357093312a006a129654df3e8099ec24ff4976fd5031b575b0d97de83` VALUES (10021, 24, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 2, "2030/12/17 14:59:59", 4.0, 0.0, "カオリ（サマー）", 0.0, 110501, 1, "2019/07/31 12:00:00", 24016, 4);
INSERT INTO `v1_8f9199e357093312a006a129654df3e8099ec24ff4976fd5031b575b0d97de83` VALUES (10021, 24, "マジムンだらけで目が回るさ～！\nふらふらさ～！", 3, "2030/12/17 14:59:59", 0.0, 0.0, "カオリ（サマー）", 0.0, 110501, 4, "2019/07/31 12:00:00", 24017, 4);
INSERT INTO `v1_8f9199e357093312a006a129654df3e8099ec24ff4976fd5031b575b0d97de83` VALUES (10021, 24, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 4, "2030/12/17 14:59:59", 5.2, 0.0, "カオリ（サマー）", 0.0, 110501, 2, "2019/07/31 12:00:00", 24018, 1);
INSERT INTO `v1_8f9199e357093312a006a129654df3e8099ec24ff4976fd5031b575b0d97de83` VALUES (10021, 24, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 5, "2030/12/17 14:59:59", 4.2, 0.0, "カオリ（サマー）", 0.0, 110501, 6, "2019/07/31 12:00:00", 24019, 5);
INSERT INTO `v1_8f9199e357093312a006a129654df3e8099ec24ff4976fd5031b575b0d97de83` VALUES (10021, 24, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 6, "2030/12/17 14:59:59", 0.0, 0.0, "カオリ（サマー）", 0.0, 110501, 2, "2019/07/31 12:00:00", 24020, 2);
INSERT INTO `v1_8f9199e357093312a006a129654df3e8099ec24ff4976fd5031b575b0d97de83` VALUES (10021, 24, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 7, "2030/12/17 14:59:59", 6.4, 0.0, "カオリ（サマー）", 0.0, 110501, 6, "2019/07/31 12:00:00", 24021, 1);
INSERT INTO `v1_8f9199e357093312a006a129654df3e8099ec24ff4976fd5031b575b0d97de83` VALUES (10021, 24, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 8, "2030/12/17 14:59:59", 0.0, 0.0, "カオリ（サマー）", 0.0, 110501, 2, "2019/07/31 12:00:00", 24022, 2);
INSERT INTO `v1_8f9199e357093312a006a129654df3e8099ec24ff4976fd5031b575b0d97de83` VALUES (10021, 24, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 9, "2030/12/17 14:59:59", 10.08, 0.0, "カオリ（サマー）", 0.0, 110501, 3, "2019/07/31 12:00:00", 24023, 6);
INSERT INTO `v1_8f9199e357093312a006a129654df3e8099ec24ff4976fd5031b575b0d97de83` VALUES (10021, 24, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 10, "2030/12/17 14:59:59", 5.0, 0.0, "カオリ（サマー）", 0.0, 110501, 2, "2019/07/31 12:00:00", 24024, 1);
INSERT INTO `v1_8f9199e357093312a006a129654df3e8099ec24ff4976fd5031b575b0d97de83` VALUES (10021, 24, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 11, "2030/12/17 14:59:59", 0.0, 0.0, "カオリ（サマー）", 0.0, 110501, 2, "2019/07/31 12:00:00", 24025, 2);
